import Navbar from "./Navbar";
import Head from "next/head";
// import "../pages/bootstrap.css";

const Layout = (props) => (
  <div>
    <Head>
      <title>Coinview</title>
      <link rel="stylesheet" href="../bootstrap.css" />
    </Head>
    <Navbar />
    {props.children}
  </div>
);
export default Layout;
